import React from 'react';
import { Typography, Paper, Box, Link } from '@mui/material';

const BasicStats = ({ data }) => {
  return (
    <Paper elevation={3} sx={{ margin: 'auto', overflow: 'hidden', p: 2 }}>
      <Box sx={{ bgcolor: 'primary.main', p: 1 }}>
        <Typography variant="subtitle1" sx={{ color: 'common.white', textAlign: 'center' }}>Basic Statistics</Typography>
      </Box>
      <Box display="flex" flexDirection="row" justifyContent="space-between">
        <div>
          <Typography variant="body1">Sector: {data.sector}</Typography>
          <Typography variant="body1">Industry: {data.industry}</Typography>
          <Typography variant="body1">Exchange: {data.exchange}</Typography>
          <Typography variant="body1">Country: {data.country_name}</Typography>
        </div>
        <div>
          <Typography variant="body1">ISIN: {data.isin}</Typography>
          <Typography variant="body1">Primary Ticker: {data.primary_ticker}</Typography>
          <Typography variant="body1">Fiscal Year End: {data.fiscal_year_end}</Typography>
          <Typography variant="body1">
            Web URL:{' '}
            <Link href={data.web_url} target="_blank" rel="noopener noreferrer">
              Link
            </Link>
          </Typography>
        </div>
      </Box>
    </Paper>
  );
};

export default BasicStats;
